var QUnit = require('qunitjs');
var test = QUnit.test;
require('qunit-tap')(QUnit, console.log);
var palindrome = require('./palindrome.js');

test("Test text normalization - remove diacritic",
    function (assert) {
        assert.equal(palindrome.normalizeText("ěščřžýáíéúů"), "escrzyaieuu");
    }
);

test("Test text normalization - remove punctuation",
    function(assert){
        assert.equal(palindrome.normalizeText("h,e..l,,l.,o"),"hello");
    }
);

test("Test text normalization - remove special chars and spaces",
    function(assert){
        assert.equal(palindrome.normalizeText("i/ have\\ a!' bad-_ feeling =%about this"),"ihaveabadfeelingaboutthis");
    }
);

test("Test text normalization - lover case",
    function(assert){
        assert.equal(palindrome.normalizeText("TARDIsISBACK"),"tardisisback");
    }
);

test("Test logic - numeric non-palindrom",
    function(assert){
        assert.equal(palindrome.testPalindrome("1234567890"),false);
    }
);

test("Test logic - short numeric palindrome (even length)",
    function(assert){
        assert.equal(palindrome.testPalindrome("1234554321"),true);
    }
);

test("Test logic - long numeric palindrome (odd length)",
    function(assert){
        assert.equal(palindrome.testPalindrome("123456789098765432109876543212345678901234567890987654321"),true);
    }
);

test("Test logic - short text non-palindrome",
    function(assert){
        assert.equal(palindrome.testPalindrome("This is not a palindrome."),false);
    }
);

test("Test logic - short text non-palindrome",
    function(assert){
        assert.equal("",false);
    }
);

